import React from 'react';
import List from '@material-ui/core/List';
import ListItem from '@material-ui/core/ListItem';
import ListItemText from '@material-ui/core/ListItemText';
import { Divider } from '@material-ui/core';


class NestedList extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            member : []
        }
    }

  render() {
      return(
     <div>     
     {this.state.member.length === 0 ? console.log("hiding") :  
    <List component="nav" style = {{width : '20%', position : 'fixed' , left : "37.3%", border: "1px",boxShadow: "1px 1px 1px 1px #888888", borderRadius:"4px", maxHeight:"20%", overflow:"scroll", overflowX:"hidden"}}>
     {this.state.member.map(row => (<ListItem style = {{textAlign : "center"}} button>
      <ListItemText primary = {`${row}`}/>
      <divider/>
    </ListItem>))}
  </List>}
  </div>)
}
}

export default NestedList;
